import Exit from './x.png'
import './PopUp2.css'

class PopUp2 extends Component{
    render(){
        return(
            <div className="popup">
            <div class="row">
               <div class="col-lg-6 col-md-6 col-sm-12 photo">
                </div>

               <div class="col-lg-6 col-md-6 col-sm-12" id="rating">
               <img onClick={this.props.closePopup} className="back-button" src={Exit}/>
                <h1>
                    Visual Re-Design <br></br>+ Checkout Process Design
                </h1>
                </div>
                 </div>
       </div>

        )
    }
}

export default PopUp2;
